description:
All your fears are about to come true. Following the critical and commercial success of &quot;Snow White XXX: An Axel Braun Parody&quot;, Wicked Pictures proudly presents another classic fairy tale re-imagined by the legendary director. Featuring rising starlet Anikka Albrite as the doomed princess, and superstar Stormy Daniels in a powerhouse performance as Maleficent, &quot;Sleeping Beauty XXX: An Axel Braun Parody&quot; is a dark, sensual and enticing feature with all the amazing costumes, production values and hot sex that Braun's fans have come to expect from him.

